import React, { useEffect, useState } from 'react';
import { Form, Button, Alert, Table, Spinner } from 'react-bootstrap';
import api from '../../services/api';

export default function ResidentVisitors() {
  const [name, setName] = useState('');
  const [phone, setPhone] = useState('');
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');
  const [loading, setLoading] = useState(false);
  const [visitors, setVisitors] = useState([]);

  const fetchVisitors = async () => {
    try {
      const res = await api.get('/visitors');
      setVisitors(res.data.filter(v => v.expectedBy && v.expectedBy._id)); // Only own expected visitors if needed
    } catch (err) {
      console.error(err);
    }
  };

  useEffect(() => {
    fetchVisitors();
  }, []);

  const submitVisitor = async (e) => {
    e.preventDefault();
    setError('');
    setSuccess('');
    setLoading(true);
    try {
      await api.post('/visitors', { name, phone });
      setSuccess('Visitor added successfully.');
      setName('');
      setPhone('');
      fetchVisitors();
    } catch (err) {
      setError(err.response?.data?.message || 'Error adding visitor');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div>
      <h3>Visitor Management</h3>

      {error && <Alert variant="danger">{error}</Alert>}
      {success && <Alert variant="success">{success}</Alert>}

      <Form onSubmit={submitVisitor} className="mb-4">
        <Form.Group controlId="visitorName" className="mb-2">
          <Form.Label>Visitor Name</Form.Label>
          <Form.Control 
            type="text" 
            value={name} 
            onChange={e => setName(e.target.value)} 
            required 
          />
        </Form.Group>
        <Form.Group controlId="visitorPhone" className="mb-2">
          <Form.Label>Visitor Phone</Form.Label>
          <Form.Control 
            type="text" 
            value={phone} 
            onChange={e => setPhone(e.target.value)} 
            required 
          />
        </Form.Group>
        <Button type="submit" disabled={loading}>
          {loading ? 'Adding...' : 'Add Visitor'}
        </Button>
      </Form>

      <h5>Expected Visitors</h5>
      {visitors.length === 0 ? <p>No visitors added.</p> :
        <Table striped bordered hover responsive>
          <thead>
            <tr>
              <th>Name</th>
              <th>Phone</th>
              <th>Status</th>
              <th>Expected By</th>
            </tr>
          </thead>
          <tbody>
            {visitors.map(v => (
              <tr key={v._id}>
                <td>{v.name}</td>
                <td>{v.phone}</td>
                <td>{v.status}</td>
                <td>{v.expectedBy?.name || 'N/A'}</td>
              </tr>
            ))}
          </tbody>
        </Table>
      }
    </div>
  );
}
